  ListItem,
  ListItemText,
  ListItemAvatar,
  Avatar,
  Chip,
  LinearProgress,
} from '@mui/material';
import {
  People as PeopleIcon,
  LocalHospital as DoctorIcon,
  EventNote as VisitIcon,
  Schedule as AppointmentIcon,
  TrendingUp as TrendingUpIcon,
  Add as AddIcon,
} from '@mui/icons-material';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, LineChart, Line, PieChart, Pie, Cell } from 'recharts';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const API_BASE_URL = 'http://localhost:3000/api';

function Dashboard() {
  const [stats, setStats] = useState({});
  const [todayVisits, setTodayVisits] = useState([]);
  const [todayAppointments, setTodayAppointments] = useState([]);
  const [monthlyData, setMonthlyData] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      const [overviewRes, visitsRes, appointmentsRes, trendsRes] = await Promise.all([
        axios.get(`${API_BASE_URL}/analytics/overview`),
        axios.get(`${API_BASE_URL}/visits/today/visits`),
        axios.get(`${API_BASE_URL}/appointments/today/appointments`),
        axios.get(`${API_BASE_URL}/analytics/monthly-trends`),
      ]);

      setStats(overviewRes.data);
      setTodayVisits(visitsRes.data);
      setTodayAppointments(appointmentsRes.data);
      setMonthlyData(trendsRes.data);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
    } finally {
      setLoading(false);
    }
  };

  const StatCard = ({ title, value, icon, color, subtitle }) => (
    <Card sx={{ height: '100%' }}>
      <CardContent>
        <Box display="flex" alignItems="center" justifyContent="space-between">
          <Box>
            <Typography color="textSecondary" gutterBottom variant="h6">
              {title}
            </Typography>
            <Typography variant="h4" component="div" sx={{ fontWeight: 'bold', color }}>
              {value}
            </Typography>
            {subtitle && (
              <Typography variant="body2" color="textSecondary">
                {subtitle}
              </Typography>
            )}
          </Box>
          <Avatar sx={{ bgcolor: color, width: 56, height: 56 }}>
            {icon}
          </Avatar>
        </Box>
      </CardContent>
    </Card>
  );

  const QuickActionButton = ({ title, icon, onClick, color = 'primary' }) => (
    <Button
      variant="contained"
      startIcon={icon}
      onClick={onClick}
      sx={{ height: 48, minWidth: 200 }}
      color={color}
    >
      {title}
    </Button>
  );

  if (loading) {
    return (
      <Box sx={{ width: '100%' }}>
        <LinearProgress />
      </Box>
    );
  }

  return (
    <Box>
      <Typography variant="h4" gutterBottom sx={{ mb: 3 }}>
        Dashboard Overview
      </Typography>

      {/* Statistics Cards */}
      <Grid container spacing={3} sx={{ mb: 4 }}>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard
            title="Total Patients"
            value={stats.totalPatients || 0}
            icon={<PeopleIcon />}
            color="#1976d2"
            subtitle="Active patients"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard
            title="Active Doctors"
            value={stats.totalDoctors || 0}
            icon={<DoctorIcon />}
            color="#2e7d32"
            subtitle="Available for consultation"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard
            title="Today's Visits"
            value={stats.todaysVisits || 0}
            icon={<VisitIcon />}
            color="#ed6c02"
            subtitle="Completed visits"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard
            title="Today's Appointments"
            value={stats.todaysAppointments || 0}
            icon={<AppointmentIcon />}
            color="#9c27b0"
            subtitle="Scheduled appointments"
          />
        </Grid>
      </Grid>

      {/* Quick Actions */}
      <Paper sx={{ p: 3, mb: 4 }}>
        <Typography variant="h6" gutterBottom>
          Quick Actions
        </Typography>
        <Box display="flex" gap={2} flexWrap="wrap">
          <QuickActionButton
            title="Add New Patient"
            icon={<AddIcon />}
            onClick={() => navigate('/patients/new')}
            color="primary"
          />
          <QuickActionButton
            title="Schedule Appointment"
            icon={<AddIcon />}
            onClick={() => navigate('/appointments/new')}
            color="secondary"
          />
          <QuickActionButton
            title="Record Visit"
            icon={<AddIcon />}
            onClick={() => navigate('/visits/new')}
            color="success"
          />
          <QuickActionButton
            title="Add Doctor"
            icon={<AddIcon />}
            onClick={() => navigate('/doctors/new')}
            color="info"
          />
        </Box>
      </Paper>

      <Grid container spacing={3}>
        {/* Monthly Trends Chart */}
        <Grid item xs={12} md={8}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Monthly Trends
              </Typography>
              <ResponsiveContainer width="100%" height={300}>
                <LineChart data={monthlyData}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="month" />
                  <YAxis />
                  <Tooltip />
                  <Line type="monotone" dataKey="visits" stroke="#1976d2" name="Visits" />
                  <Line type="monotone" dataKey="appointments" stroke="#dc004e" name="Appointments" />
                </LineChart>
              </ResponsiveContainer>
            </CardContent>
          </Card>
        </Grid>

        {/* Today's Schedule */}
        <Grid item xs={12} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Today's Schedule
              </Typography>
              <List>
                {todayAppointments.slice(0, 5).map((appointment) => (
                  <ListItem key={appointment._id} divider>
                    <ListItemAvatar>
                      <Avatar sx={{ bgcolor: 'primary.main' }}>
                        <AppointmentIcon />
                      </Avatar>
                    </ListItemAvatar>
                    <ListItemText
                      primary={appointment.patientId?.name || 'Unknown Patient'}
                      secondary={`${appointment.appointmentTime} - ${appointment.doctorId?.name || 'Unknown Doctor'}`}
                    />
                    <Chip
                      label={appointment.status}
                      size="small"
                      color={appointment.status === 'Confirmed' ? 'success' : 'warning'}
                    />
                  </ListItem>
                ))}
                {todayAppointments.length === 0 && (
                  <ListItem>
                    <ListItemText primary="No appointments today" />
                  </ListItem>
                )}
              </List>
            </CardContent>
          </Card>
        </Grid>

        {/* Recent Visits */}
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Recent Visits
              </Typography>
              <List>
                {todayVisits.slice(0, 5).map((visit) => (
                  <ListItem key={visit._id} divider>
                    <ListItemAvatar>
                      <Avatar sx={{ bgcolor: 'success.main' }}>
                        <VisitIcon />
                      </Avatar>
                    </ListItemAvatar>
                    <ListItemText
                      primary={visit.patientId?.name || 'Unknown Patient'}
                      secondary={`${visit.doctorId?.name || 'Unknown Doctor'} - ${visit.visitType}`}
                    />
                    <Chip
                      label={visit.status}
                      size="small"
                      color={visit.status === 'Completed' ? 'success' : 'warning'}
                    />
                  </ListItem>
                ))}
                {todayVisits.length === 0 && (
                  <ListItem>
                    <ListItemText primary="No visits today" />
                  </ListItem>
                )}
              </List>
            </CardContent>
          </Card>
        </Grid>

        {/* Financial Overview */}
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Financial Overview
              </Typography>
              <Box display="flex" flexDirection="column" gap={2}>
                <Box display="flex" justifyContent="space-between">
                  <Typography>Total Revenue</Typography>
                  <Typography variant="h6" color="success.main">
                    ${stats.totalRevenue || 0}
                  </Typography>
                </Box>
                <Box display="flex" justifyContent="space-between">
                  <Typography>Pending Payments</Typography>
                  <Typography variant="h6" color="warning.main">
                    {stats.pendingPayments || 0}
                  </Typography>
                </Box>
                <Box display="flex" justifyContent="space-between">
                  <Typography>Active Patients</Typography>
                  <Typography variant="h6" color="primary.main">
                    {stats.activePatients || 0}
                  </Typography>
                </Box>
              </Box>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </Box>
  );
}

export default Dashboard;
